ción de pedido enviado al comprador.','Post-purchase note'=>'Nota de posventa','Custom fields'=>'Campos personalizados','Show custom fields'=>'Mostrar campos personalizados','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Utiliza atributos globales para permitir a los compradores filtrar y buscar este producto. Utiliza atributos personalizados para proporcionar información detallada del producto.','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Los campos personalizados pueden utilizarse de diversas formas, como para compartir información más detallada sobre los productos, mostrar más campos de entrada u organizar el inventario interno. %1$sMás información sobre los campos personalizados%2$s','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Según la %1$sconfiguración de tu tienda%2$s, los impuestos no están activados.','Unable to create backup post for order %d.'=>'No se puede crear una copia de seguridad del pedido %d.','%s is not a valid order property.'=>'%s no es una propiedad de pedido válida.' . "\0" . '%s no son propiedades de pedido válidas.','%s is an internal meta key. Use --props to set it.'=>'%s es una palabra clave interna. Utiliza --props para configurarla.' . "\0" . '%s son palabras clave internas. Utiliza --props para configurarlas.','The backup datastore does not support updating orders.'=>'El almacén de datos de copia de seguridad no admite la actualización de pedidos.','Overriding existing data with an already registered key is not allowed'=>'Sustituir los datos existentes con una clave ya registrada no está permitido','New custom field name'=>'Nuevo nombre de campo personalizado','Please review the errors above.'=>'Revisa los errores anteriores.','WooCommerce Blocks development mode