s">en el editor</a> con tu tema activo.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce ha intentado instalar <a href="%1$s">el plugin Legacy REST API</a> porque este sitio tiene <a href="%2$s">la API REST heredada activada</a> o tiene <a href="%3$s">webhooks heredados definidos</a>, pero no se ha podido completar la instalación (puedes ver los detalles del error en <a href="%4$s">los registros de WooCommerce</a>). Instala y activa el plugin de forma manual. <a href="%5$s">Más información</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce ha instalado y activado <a href="%1$s">el plugin Legacy REST API</a> porque este sitio tiene <a href="%2$s">la API REST heredada activada</a> o tiene <a href="%3$s">webhooks heredados definidos</a>. <a href="%4$s">Más información</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce ha instalado el plugin Legacy REST API pero no ha podido activarlo. Puedes ver el contexto para obtener más información.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce ha instalado <a href="%1$s">el plugin Legacy REST API</a> porque este sitio tiene <a href="%2$s">la API REST heredada habilitada</a> o tiene <a href="%3$s">webhooks heredados definidos</a>, pero no ha podido activarlo (puedes ver los detalles del error en <a href="%4$s">los registros de WooCommerce</a>). Ve a <a href="%5$s">la página de plugins</a> y actívalo de forma manual. <a href="%6$s">Más información</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Introduce una dirección de correo electrónico válida al realizar la compra para utilizar el código de cupón «%s».','Please enter a valid email to use coupon code "%s".'=>'Introduce una dirección de correo electrónico válida para utilizar el código de cupón «%s».','To allow logging, make %s writable.'=>'Para permitir el registro, haz que %s tenga permisos de escritura.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Recogida local: configura las ubicaciones de recogida en la <a href="%s">página de configuración de la recogida local</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Explora un nuevo método de entrega mejorado que te permite ofrecer fácilmente una o más ubicaciones de recogida a tus clientes en la <a href="%s">página de configuración de la recogida local</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'La recopilación de datos de uso nos permite adaptar la experiencia de configuración de tu tienda, ofrecer contenido más relevante y ayudar a que WooCommerce sea mejor para todos.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download<