gar','First order received'=>'Primer pedido recibido','Remove legacy coupon menu'=>'Eliminar el menú de cupones heredado','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Los cupones ahora se pueden gestionar desde Marketing > Cupones. Haz clic en el botón a continuación para eliminar el elemento de menú heredado WooCommerce > Cupones.','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Recibe avisos sobre la actividad de la tienda, incluidos nuevos pedidos y valoraciones de productos directamente en tus dispositivos móviles con la aplicación Woo.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Falló la creación de la tabla %1$s de WooCommerce. ¿Tiene el usuario %2$s privilegios de CREATE en la base de datos %3$s?','The admin note layout has a wrong prop value.'=>'El diseño de la nota de administrador tiene un valor de referencia incorrecto.','Do you need help with adding your first product?'=>'¿Necesitas ayuda para añadir tu primer producto?','Coupon management has moved!'=>'¡La gestión de cupones se ha movido!','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Iniciar una web de moda es emocionante, pero también puede parecer abrumador. En este artículo, te guiaremos a través del proceso de configuración, te enseñaremos a crear listas de productos exitosas y te mostraremos cómo comercializar a tu audiencia ideal.','Start your online clothing store'=>'Inicia tu tienda de ropa en línea','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Este tutorial en vídeo te ayudará en el proceso de añadir tu primer producto en WooCommerce.','Share feedback'=>'Compartir comentarios','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Ahora que nos has elegido como socio, nuestro objetivo es asegurarnos de que proporcionemos las herramientas adecuadas para satisfacer tus necesidades. Esperamos recibir tus comentarios sobre la experiencia de configuración de la tienda para que podamos mejorarla en el futuro.','Watch tutorial'=>'Ver el tutorial','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Cambiar entre plataformas de comercio electrónico puede parecer un gran obstáculo que superar, pero mover tus productos, clientes y pedidos a WooCommerce es más fácil de lo que podrías pensar. Este artículo te ayudará con este proceso.','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Suscriptions te permiten introducir una variedad de suscripciones para productos y servicios físicos o virtuales. Crea clubes de productos del mes, suscripciones de servicios semanales o incluso paquetes de facturación de software anuales. Añade tarifas de registro, ofrece periodos de prueba gratuitos o establece períodos de vencimiento.','Do you want to migrate from Shopify to WooCommerce?'=>'¿Quieres migrar de Shopify a WooCommerce?','Taita-Taveta'=>'Taita-Taveta','Tana River'=>'Tana River','Tharaka-Nithi'=>'Tharaka-Nithi','Trans Nzoia'=>'Trans Nzoia','Turkana'=>'Turkana','Uasin Gishu'=>