ello, análisis, marketing, pasarelas de pago, proveedores de envío, e incrustados de terceros.','What we share with others'=>'Lo que compartimos con otros','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Los miembros de nuestro equipo tienen acceso a esta información para ayudar a completar pedidos, procesar reembolsos y darte soporte.','Customer information like your name, email address, and billing and shipping information.'=>'La información de cliente, como tu nombre, dirección de correo electrónico, y la información de facturación y envío.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'La información de pedidos, como qué se compró, cuándo se compró y dónde se debería enviar, y','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Los miembros de nuestro equipo tienen acceso a la información que nos ofreces. Por ejemplo, los administradores y gestores de tienda pueden acceder:','Who on our team has access'=>'Quién de nuestro equipo tiene acceso','We will also store comments or reviews, if you choose to leave them.'=>'También almacenamos comentarios o valoraciones, si eliges dejarlos.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Normalmente almacenamos información sobre ti durante el tiempo que necesitemos la información para los propósitos para los que la recopilamos y usamos, y no estemos legalmente obligados a seguir guardándola. Por ejemplo, almacenaremos información de los pedidos durante XXX años para propósitos de impuestos y contabilidad. Esto incluye tu nombre, dirección de correo electrónico y direcciones de facturación y envío.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Si creas una cuenta almacenaremos tu nombre, dirección, correo electrónico y número de teléfono, lo que usaremos para el proceso de pago y futuros pedidos.','Process payments and prevent fraud'=>'Procesar pagos y evitar el fraude','Improve our store offerings'=>'Mejorar las ofertas de nuestra tienda','Comply with any legal obligations we have, such as calculating taxes'=>'Cumplir con cualquier obligación legal que tengamos, como cálculos de impuestos','Set up your account for our store'=>'Configurar tu cuenta para nuestra tienda','Send you information about your account and order'=>'Enviarte información sobre tu cuenta y pedido','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Cuando nos compras algo te pedimos que facilites información que incluye tu nombre, dirección de facturación, dirección de envío, dirección de correo electrónico, número de teléfono, detalles de la tarjeta de crédito/pago e información adicional opcional como el nombre de usuario y la contraseña. Usaremos esta información para propósitos como:','Respond to your requests, including refunds and complaints'=>'Responder a tus solicitudes, incluidos reembolsos y reclamaciones','Send you marketing messages, if you choose to receive them'=>'Enviarte mensajes promocionales, si eliges recibirlos','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Observación: puede que quieras detallar tu política de cookies, y enlazar desde aquí a esta sección.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'También usamos cookies para realizar el seguimiento de los contenidos del carrito mientras navegas por nuestro sitio.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Dirección de envío: te pediremos que facilites esto para que podamos, por ejemplo, estimar el coste del envío antes de que hagas un pedido, ¡y enviarte el pedido!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Ubicación, dirección IP y tipo de navegador: usaremos esto para propósitos como estimar impuestos y costes de envío','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Productos que has visto: Los usaremos para, por ejemplo, mostrarte los productos que has visto recientemente','While you visit our site, we’ll track:'=>'Mientras visitas nuestro sitio realizaremos el seguimiento de:','What we collect and store'=>'Lo que recopilamos y almacenamos','We collect information about you during the checkout process on our store.'=>'Recopilamos información tuya durante el proceso de pago en nuestra tienda.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Este texto de muestra incluye los básicos sobre qué datos personales recopila, almacena y comparte tu tienda, así como quién tiene acceso a esos datos. Dependiendo de qué ajustes estén activos y qué plugins adicionales se use, la información específica compartida por tu tienda puede variar. Te recomendamos que consultes a un abogado para decidir qué información mostrar en tu política de privacidad.','Browser User Agent'=>'Agente de usuario del navegador','Items Purchased'=>'Productos comprados','Order Number'=>'Número del pedido','Access granted'=>'Acceso concedido','Download count'=>'Contador de descargas','User email'=>'Correo electrónico del usuario','Payment Tokens'=>'Tokens de pago','Token'=>'Token','optional'=>'opcional','Display name'=>'Nombre visible','Display name cannot be changed to email address due to privacy concern.'=>'El nombre visible no se puede cambiar a la dirección de correo electrónico debido a cuestiones de privacidad.','display name%1$s %2$s'=>'%1$s %2$s','Shipping State'=>'Provincia del envío','Shipping Postal/Zip Code'=>'Código postal del envío','Shipping City'=>'Ciudad del envío','Shipping Company'=>'Empresa del envío','Shipping Last Name'=>'Apellidos del envío','Shipping First Name'=>'Nombre del envío','Phone Number'=>'Número de teléfono','Billing State'=>'Provincia de facturación','Billing Postal/Zip Code'=>'Código postal de facturación','Billing City'=>'Ciudad de facturación','Billing Company'=>'Empresa de facturación','Billing Last Name'=>'Apellidos de facturación','Billing First Name'=>'Nombre de facturación','Download ID'=>'ID de la descarga','Customer Data'=>'Datos del cliente','Error during status transition.'=>'Error durante el cambio de estado.','Update status event failed.'=>'Falló el evento de actualización de estado.','Payment complete event failed.'=>'Falló el evento de completar el pago.','Please read and accept the terms and conditions to proceed with your order.'=>'Por favor, lee y acepta los términos y condiciones para proceder con tu pedido.','Unserializing instances of this class is forbidden.'=>'Las instancias sin serializar para esta clase están prohibidas.','Cloning is forbidden.'=>'El clonado está prohibido.','Deleted all active sessions, and %d saved carts.'=>'Borradas todas las sesiones activas, y guardados %d carritos.','This tool will delete all customer session