tes están sin pagar y podrían haber sido abandonados por el cliente. Se enviarán a la papelera tras la duración especificada.','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Los pedidos cancelados están sin pagar y podrían haber sido cancelados por el dueño de la tienda o el cliente. Se enviarán a la papelera tras la duración especificada.','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Los pedidos fallidos están sin pagar y podrían haber sido abandonados por el cliente. Se enviarán a la papelera tras la duración especificada.','Retain completed orders'=>'Conservar pedidos completados','Retain cancelled orders'=>'Conservar pedidos cancelados','Retain failed orders'=>'Conservar pedidos fallidos','External object cache'=>'Caché de objeto externo','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Conserva pedidos completados una duración especificada antes de anonimizar los datos personales que contengan.','Privacy policy'=>'Política de privacidad','Accounts &amp; Privacy'=>'Cuentas y privacidad','Checkout privacy policy'=>'Política de privacidad al finalizar compra','Optionally add some text about your store privacy policy to show during checkout.'=>'Opcionalmente, añade algo de texto sobre la política de privacidad de tu tienda, que se mostrará al finalizar compra.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Opcionalmente, añade algo de texto sobre la política de privacidad de tu tienda, que se mostrará en los formularios de registro de la cuenta.','Registration privacy policy'=>'Política de privacidad en el registro','Filter by registered customer'=>'Filtrar por cliente registrado','Use previous column mapping preferences?'=>'¿Usamos las anteriores preferencias de asignación de columnas?','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Tus datos personales se utilizarán para procesar tu pedido, mejorar tu experiencia en esta web y otros propósitos descritos en nuestra %s.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Tus datos personales se utilizarán para procesar tu pedido, mejorar tu experiencia en esta web, gestionar el acceso a tu cuenta y otros propósitos descritos en nuestra %s.','Allowed emails'=>'Correos electrónicos permitidos','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Cuentas inactivas son las que no han accedido, o realizado algún pedido, durante una duración especificada. Se borrarán. Cualquier pedido se convertirá en pedido de invitado.','Retain pending orders '=>'Conservar pedidos pendientes','Retain inactive accounts '=>'Conservar cuentas inactivas','Account erasure requests'=>'Solicitudes de borrado de cuenta','Personal data retention'=>'Conservación de datos personales','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Elige cuánto tiempo quieres conservar los datos personales cuando ya no sea necesario procesarlos. Deja las siguientes opciones en blanco para conservar estos datos indefinidamente.','privacy page'=>'página de privacidad','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Esta sección controla la visualización de la política de privacidad de tu web. Los siguientes avisos de privacidad no se mostrarán a menos que se establezca una %s.','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lista de correos electrónicos permitidos contra los que probar el correo electrónico de facturación del cliente al hacer un pedido. Separa las direcciones de correo electrónico con comas. También puedes usar un asterisco (*) para hacer coincidir partes de un correo electrónico. Por ejemplo «*@gmail.com» coincidirá con todas las direcciones de correo electrónico de gmail.','Removed personal data from %s order.'=>'Eliminados datos personales de %s pedido' . "\0" . 'Eliminados datos personales de %s pedidos','Remove personal data'=>'Eliminar datos personales','View &amp; Customize'=>'Ver y personalizar','Review Settings'=>'Revisar ajustes','You can also:'=>'También puedes:','You\'re ready to add products to your store.'=>'Ya estás listo para añadir productos a tu tienda.','Create some products'=>'Crea algunos productos','Continue with WooCommerce Services'=>'Seguir con WooCommerce Services','Connect your store to activate WooCommerce Services'=>'Conecta tu tienda para activar WooCommerce Services','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'¡Gracias por usar Jetpack! Tu tienda está casi lista: para activar servicios como %s simplemente conecta tu tienda.','Mailchimp icon'=>'Icono de MailChimp','Join the 16 million customers who use Mailchimp. Sync list and store data to send automated emails, and targeted campaigns.'=>'Únete a 16 millones de clientes que  usan MailChimp. Sincroniza tus listas y almacena datos para enviar correos electrónicos automáticos, y campañas segmentadas.','Mailchimp'=>'MailChimp','automated taxes icon'=>'icono de impuestos automáticos','Save time and errors with automated tax calculation and collection at checkout. Powered by WooCommerce Services and Jetpack.'=>'Ahorra tiempo y errores con e